(function($,Drupal,once){Drupal.behaviors.webformOptionsAdmin={attach:function(context){$(once('webform-options-sync','.js-webform-options-sync',context)).each(function(){var name=this.name;var $value=$(this);var $text=$('input[name="'+name.replace(/\[value\]$/,'[text]')+'"]');$value.on('focus',function(){var sync=$value.val()===$text.val();$value.data('webform_options_sync',sync);if(sync){$text.prop('readonly',!0).closest('.js-form-item, .js-form-wrapper').addClass('webform-readonly')}});$value.on('blur',function(){if($value.data('webform_options_sync')){$text.prop('readonly',!1).closest('.js-form-item, .js-form-wrapper').removeClass('webform-readonly')}});$value.on('keyup',function(){if($value.data('webform_options_sync')){$text.val($value.val())}})})}}})(jQuery,Drupal,once)